function refreshTableNational(){
	tableNationAbsVal.innerHTML = absValsNational[currentYearKey];
	tableNationRelVal.innerHTML = relValsNational[currentYearKey];
}

function fillPaths(){
  for(var dept in paths){
    var percentage = gapsDepts[dept][currentYearKey];	
	var fillStr = null;
	for (d=0;d<deciles.length; d++){
		if(percentage < deciles[d]){
			fillStr = palette[d];
			break;
		}
	}
	if(fillStr == null){
		fillStr = palette[palette.length-1];
	}
	
	/*
    if(percentage>0){
      fillStr = 'hsl(80, '+Math.min(100,percentage+20)+', 50)';
    } else {
      fillStr = 'hsl(12, '+Math.min(-percentage+15, 100)+', 50)';
    }
	*/
	
    deptFills[dept] = fillStr;
	if(selectedDept != dept){
	  paths[dept].animate({
		fill: fillStr,
		'fill-opacity': 1
		}, 2000, bindHighlightDepartements);
	}
  }
  
  //var nationalCercleRadius = CIRCLE_MAX_RADIUS * totalPercentagesData[currentYearKey] / 100;
  //raphTotalCircle.animate({r: nationalCercleRadius, fill: 'hsl(80,70,50)'}, 1000, "backOut");
}

function bindHighlightDepartements(){
  for (var dept in paths) {
    (function (st, dept) {
      st[0].style.cursor = "pointer";
      st[0].onmouseover = function () {
        st.animate({fill: "#EFCA52"}, 300);
        raphPaper.safari();
      };
      st[0].onclick = function(){
		if(selectedDept != -1){
			paths[selectedDept].animate({fill: deptFills[selectedDept], stroke: "#d5d5d5"}, 300);
		}
        selectedDept = dept;
		refreshTableDept();
      };
      st[0].onmouseout = function () {
        if( selectedDept != dept ){
          st.animate({fill: deptFills[dept]}, 300);
          raphPaper.safari();
        }
      };
    })(paths[dept], dept);
  }
}

function refreshTableDept(){
	if(selectedDept != -1){
		/*var temp = (gapsDepts[selectedDept][currentYearKey] > 0) ? '+' : '';
		temp += gapsDepts[selectedDept][currentYearKey] + "%"; */
		tableDeptName.innerHTML = departementsNames[selectedDept];
		tableDeptRelVal.innerHTML = relValsDepts[selectedDept][currentYearKey];
		//tableDeptRelGap.innerHTML = temp;
		tableDeptAbsVal.innerHTML = absValsDepts[selectedDept][currentYearKey];
		tableDeptAbsValP.style.display = 'block';
		tableDeptRelValP.style.display = 'block';
		tableDeptSoitP.style.display = 'block';
		//tableDeptRelGapP.style.display = 'block';
	} else {
		tableDeptAbsValP.style.display = 'none';
		tableDeptRelValP.style.display = 'none';
		tableDeptSoitP.style.display = 'none';
		//tableDeptRelGapP.style.display = 'none';
	}
}

